@TheViewFromLL2 1/There was a mass shooting by a citizen yesterday.

A fight over drugs led to the gunfire, Cleveland police said. No other information regarding the shooting was released.

Jaylin Glanton of Maple Heights died from a gunshot wound to his shoulder. He was found dead at the scene.

